import test from "../../images/event_test.png";
import classes from "./EventCard.module.css";

function EventCard({ index, title, createdAt, photo }) {

    const hoverClass =
    index % 3 === 1 ? classes.yellowHover :
    index % 3 === 2 ? classes.blueHover :
    classes.purpleHover;

    const formattedTime = createdAt.split("T")[0];

    return (
        <div className={`${classes.container} ${hoverClass}`}>
            <img
                src={test}
                alt="預設平台頭像"
                className={classes.image}
            />
            <div className={classes.title}>{title}</div>
            <div className={classes.time}>2024.09.17</div>
        </div>
    );
}

export default EventCard;
